import "./ProfileNotFound.css";

const ProfileNotFoundPage = () => {
  return (
    <div className="container">
      <title>Error 404 Profile not found</title>
      <h2>404 Profile Not Found</h2>
    </div>
  );
};

export default ProfileNotFoundPage;
